import axios from "axios";
import {GET_COUNTRIES} from "../const";


export function getCountries(){
    return async function (dispatch){
        const info = axios.get("http://localhost:3001/countries");
        return dispatch({
            type:GET_COUNTRIES,
            payload: info.data
        })
    }


}
